import Menu from './Menu';

const Header = () => (
  <div className="header-wrapper">
    <Menu />
    <style jsx>{`
      .header-wrapper {
        padding: 8px;
        display: flex;
        justify-content: space-between;
        align-items: center;
      }
      @media (max-width: 600px) {
        .header-wrapper {
          display: block;
          text-align: center;
        }
      }
    `}</style>
  </div>
);

export default Header;
